import Icon from "../../components/Icon/Icon";
import { GlobalThemes } from "../../ThemeManager";
import "./EightiesTheme.scss";
const EightiesTheme = ({}: {}) => {
  return (
    <div className={"arcadeContainer " + GlobalThemes.Arcade}>
      <div className={"arcadeTopContainer"}>
        <Icon icon="Coin" fontSize={60} />
        <div className="arcadeTitleContainer">
          <div className="headline one titleText">Welcome</div>
          <div className="headline two primaryText">to</div>
          <div className="headline one titleText">Vincent's</div>
          <div className="headline one titleText">Arcade</div>
        </div>
      </div>
    </div>
  );
};
export default EightiesTheme;
